import './App.css';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Main from './components/Main';


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path='/' element={<Main />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
